CREATE OR REPLACE FUNCTION fpy_get_nfe_polishop_xls(arquivo text)
  RETURNS integer AS
$BODY$

import traceback

try:
    import xlrd
    import io
    import base64


    """Abre o arquivo base 64"""
    #arq_xls = "c:\\polishop\\polishop64.xls"
    #a = open(arq_xls,'rb')
    #t = a.read()
    #a.close()

    xls = io.BytesIO(base64.b64decode(arquivo.encode()))



    # Abre o arquivo
    xls = xlrd.open_workbook(file_contents = xls.read())
    # Pega a primeira planilha do arquivo
    plan = xls.sheets()[0]


    sql_insert = """
    INSERT INTO scr_nfe_polishop (
        numero_nota_fiscal,
        serie_nota_fiscal,
        valor,
        peso,
        cubagem,
        data_emissao,
        destinatario_cnpj,
        chave_nfe
    ) VALUES (
        %s::integer,
        '%s'::character(3),
        %f::numeric(12,2),
        %f::numeric(16,4),
        %f::numeric(20,6),
        '%s'::date,
        '%s'::character(14),
        '%s'
    )
    """

    cmds = []
    for i in range(plan.nrows):
        if i == 0:
            
            continue

        row = plan.row_values(i)
        plpy.notice(row)
        nnf = row[1]

        try:
            serie = row[2]
        except:
            plpy.notice('Tipo serie',type(serie))

            serie = '0'
            
        valor = row[3]
        chave_nfe = row[11]
        peso = row[8]
        cubagem = row[9]
        demi = row[4]        
        demi = demi[-4:] + '-' + demi[3:5] + '-' + demi[0:2]
        cnpj = row[5].replace('.','').replace('-','').replace('/','')



        cmds.append(sql_insert % (nnf,serie,valor,peso,cubagem,demi,cnpj,chave_nfe or ''))


    sql = ';'.join(cmds)

    plpy.execute(sql);
    return 1
except:
    plpy.notice(traceback.format_exc())
    return 0
    
$BODY$
  LANGUAGE plpython3u VOLATILE;


ALTER FUNCTION fpy_get_nfe_polishop_xls(arquivo text) OWNER TO softlog_medilog;